import React, { useState } from 'react';
import './App.css';

function App() {
    const [count, setCount] = useState(0);
    let n = document.getElementById("num").value;
    return (
      <div>
        <p>You clicked {n+count} times</p>
        <input type="text" id="num"/>
        <button onClick={() => setCount(count + 1)}>
          Click me
        </button>
      </div>
    );
  }

export default App;
